import { AppBar, Toolbar, styled } from '@mui/material';

import { logoURL } from '../../constants/constant';

const StyledToolBar = styled(Toolbar)`
   background: #121212;
   min-height: 56px !important;
`;

const Logo = styled()


const Header = () => {
    return (
        <AppBar>
            <StyledToolBar>
               <img src={logoURL} alt="logo" />
            </StyledToolBar>
        </AppBar>
    )
}

export default Header;
